import React from 'react';
import Navbar from '../../components/Layouts/Navbar/Navbar';
import { TextSemi, TextMedium16 } from '../../utils/typography';
import { Input, Button } from '@geist-ui/react';
import { LoginContainer } from './register.style';
function register() {
  return (
    <>
      <Navbar />
      <LoginContainer className='login__container'>
        <div className='login__form'>
          <div className='login__form-heading'>
            <TextSemi>Create an Account</TextSemi>
          </div>
          {/* <div className='login__form-fields'> */}
          <div className='login__form-input-group'>
            <TextMedium16>Email Address</TextMedium16>
            <Input
              className='login__form-input'
              size='medium'
              placeholder='Johndoe@domain.com'
            />
          </div>
          <div className='login__form-input-group'>
            <TextMedium16>Password</TextMedium16>
            <Input size='medium' placeholder='Johndoe@domain.com' />
          </div>
          <div className='login__form-input-group'>
            <Button>Sign up</Button>
          </div>
          {/* </div> */}
        </div>
      </LoginContainer>
    </>
  );
}

export default register;
